class Counter2 extends Component{
    state = {
        counter: 0
    }

    increment = ()=>{
        this.setState({
            counter: this.state.counter+2
        })
    }
    render(){
        return(

        <div>
            <p>{this.state.counter}</p>
            <button onClick={this.increment}>Inctement</button>
        </div>
        )
    }
}
